Ext.define('liftnet.store.sx_gettrno', {
    extend: 'Ext.data.Store',

    requires: [
        'Ext.data.Field'
    ],

    config: {
        storeId: 'sx_gettrno',
        fields: [
            {
                name: 'trno'
            }
        ]
    },

    loadDat: function(onSuccess, onFailure, parm) {
        console.log(parm);
        var me = this;
        if(global.isWorklight()) {
            // adapter取数
            var url = '/adapters/shouxin/api/1.0/mobiletraddinfo';
            callPostAdapter(
                url, parm,
                function(ret) {
                    me.setData(ret.data);
                    onSuccess(ret.data[0].trno);
                },
            onFailure);
        } else {
                this.setData({
                    trno:'TR2015233',
                });
            // 演示数据
            onSuccess('TR2015233');
        }
    }

});